    data: |
      SELECT col1 * col1 + col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 36 * - + ( + col0 ) + + col2 NOT BETWEEN ( + col1 ) AND + 95;
  - name: tab2

outputs:
  - name: q8959.out
    data: |
      2624
      4547
      5969
